export function VideoList() {
    return (
        <>
            <h1>Video List</h1>
            {
                videos.map((video)=>{
                    return(
                        <div key={video.id}>
                            <p>{video.name}</p>
                            <p>{video.duration}</p>
                            <button>Like!</button>
                        </div>
                    )
                })
            }
        </>
    )
}
